export default function HeaderNavigation() {
    return (
        <nav className="flex lg:flex-1 items-center gap-3" aria-label="Global">
            <a href="/" className="-m-1.5 p-1.5 text-base font-semibold leading-6 text-white">
                <img
                    src={"/images/logo.png"}
                    alt={"logo"}
                />
            </a>
        </nav>
    )
};
